# gerar arquivo 

def criandoLivrosOrganizadosPorQ():
    t_q = dict()

    for item in titulos:
        if not (item in t_q):
            t_q[item] = 1
        else:
            t_q[item]+= 1
    
    # Definir o caminho do diretório "crud com arquivo"
    diretorio_destino = os.path.join(os.getcwd(), "crud com arquivo")
    fileName = os.path.join(diretorio_destino, "dadosOriginais.txt")


    # Imprimir o caminho absoluto antes de criar o arquivo
    print(f"Caminho absoluto do arquivo: {os.path.abspath(fileName)}")

    # Abrir o arquivo no modo de append
    with open(fileName, 'a') as file:
        file.write("Titles\n")  # Cabeçalho
        for key, value in t_q.items():
            file.write(f"{key}: {value}\n")

    print(f"Arquivo gerado em: {fileName}")

#gerando livros diretamente da lista
# Definir o caminho do diretório "crud com arquivo"
def criadoLivrosAleatoriosERepetidos():
    diretorio_destino = os.path.join(os.getcwd(), "crud com arquivo")
    fileName = os.path.join(diretorio_destino, "livrosAleatoriosERepetidos.txt")


    # Imprimir o caminho absoluto antes de criar o arquivo
    print(f"Caminho absoluto do arquivo: {os.path.abspath(fileName)}")

    # Abrir o arquivo no modo de append
    with open(fileName, 'a') as file:
        for item in titulos:
            file.write(f"{item},")

    print(f"Arquivo gerado em: {fileName}")

for i in range(1000):
    criadoLivrosAleatoriosERepetidos()